import { AuthRoutes } from '../modules/Routes';
import Auth from './Auth';

const Main = () => {
  return (<div>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={Auth} />
      </Routes>
    </BrowserRouter>
  </div>
  );
}

export default Main;
